import React from 'react';
import { FormControl, InputLabel, FormHelperText, Select, MenuItem } from '@material-ui/core';

export default function Sel({ choice, action, specs }) {
    return (
        <FormControl className={specs}>
            <InputLabel id="demo-simple-select-label">Item</InputLabel>
            <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={choice}
          onChange={action}
        >
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Twenty</MenuItem>
          <MenuItem value={30}>Thirty</MenuItem>
        </Select>
        <FormHelperText>Choose your desired item</FormHelperText>
      </FormControl>
    );
}
